import React from 'react';
import '../styles/Footer.css';  

const Footer = () => {
  return (
    <footer className="footer-container">
      <p>&copy; 2025 Moja Turistička Aplikacija. Sva prava pridržana.</p>
    </footer>
  );
};

export default Footer;
